      </header>
            <h1>Request a Book</h1>
            <Form>
            <input
          type="text"
          name="name"
          placeholder="Plant name"
          value=""
          onChange={(e) => setName(e.target.value)}
        />
            </Form>
        </div>
    )
}

export default Request
